import React from "react";

import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
// import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
// import FormLabel from '@mui/material/FormLabel';
// import FormControl from '@mui/material/FormControl';
// import FormControlLabel from '@mui/material/FormControlLabel';
// import HighlightedCode from 'docs/src/modules/components/HighlightedCode';
import Paper from '@mui/material/Paper';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';

function LinkTab(props) {
    return (
        <Tab
            component="a"
            onClick={(event) => {
                event.preventDefault();
            }}
            {...props}
        />
    );
}

const Account = props => {

    const [value, setValue] = React.useState(0)
    const changeHandler = (event, newValue) => {
        setValue(newValue)
    }
    return (
        <React.Fragment>
            {/* <Box sx={{ width: '100%' }}>
                <Tabs value={value} onChange={changeHandler} aria-label="nav tabs example" indicatorColor="secondary">
                    <LinkTab label="Tasks" href="/drafts" />
                    <LinkTab label="Bills" href="/trash" />
                    {/* <LinkTab label="Page Three" href="/spam" /> */}
            {/* </Tabs> */}
            {/* </Box> */}
            <Box sx={{ width: '100%', height: '20%', typography: 'body1' }}>
                <TabContext value={value}>
                    <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                        <TabList onChange={changeHandler} aria-label="lab API tabs example">
                            <Tab label="Item One" value="1" />
                            <Tab label="Item Two" value="2" />
                            <Tab label="Item Three" value="3" />
                        </TabList>
                    </Box>
                    <TabPanel value="1">
                        <Grid sx={{ flexGrow: 1 }} container spacing={2} >
                            <Box sx={{flexGrow :1, alignItems: ' center'}}><Fab color="primary" aria-label="add" >
                                <AddIcon />
                            </Fab> </Box>
                            <Grid item xs={12}>
                                <Grid container justifyContent="center" spacing={3}>
                                    {[0, 1, 2].map((value) => (
                                        <Grid key={value} item>
                                            <Paper
                                                sx={{
                                                    height: 420,
                                                    width: 400,
                                                    backgroundColor: (theme) =>
                                                        theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
                                                }}
                                            />
                                        </Grid>
                                    ))}
                                </Grid>
                            </Grid>
                        </Grid>
                    </TabPanel>
                    <TabPanel value="2">Item Two</TabPanel>
                    <TabPanel value="3">Item Three</TabPanel>
                </TabContext>
            </Box>

        </React.Fragment>
    )

};
export default Account;
